import React from "react";
import {
  Navbar,
  Button,
  Container,
  Nav,
  Form,
  FormControl,
} from "react-bootstrap";

function Header() {
  return (
    <img
      src={`${process.env.PUBLIC_URL}/header.png`}
      class="img-fluid"
      alt="header"
    />
  );
}
export default Header;
